import { createRoot } from 'react-dom/client'
import { Provider } from 'react-redux';

import { MyApp } from './App'

const domNode = document.getElementById('root');
const root = createRoot(domNode);

function App() {
  <MyApp />
}

root.render(
  <Provider store={store}>
    <App />
  </Provider>
);
